    "## Introduction  <a class=\"anchor\"  id=\"introduction\"></a>\n",
    "\n",
    "This case study is part of the Google Data Analytics Capstone: Complete a Case Study  course on Coursera. \n",
    "\n",
    "#### Title for the Case Study: \n",
    "\n",
    "BellaBeat - How Can a Wellness Technology Company Play It Smart?\n",
    "\n",
    "#### Case Study Context and Background:\n",
    "\n",
    "Bellabeat, a high-tech company that manufactures health-focused smart products.\n",
    "Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart\n",
    "device fitness data could help unlock new growth opportunities for the company.\n",
    "\n",
    "#### Methodology:\n",
    "\n",
    "Using the six steps of the data analysis process: ask, prepare, process, analyze, share, \n",
    "and act to discover valuable insights to achieve the business task."
   ]
  },
