    "## Step 1: Ask <a class=\"anchor\"  id=\"step1\"></a>\n",
    "\n",
    "This step focuses on defining the business task to be solved, understanding the stakeholder's expectation and see the whole case study in context. \n",
    "\n",
    "### 1.1 Business Task: <a class=\"anchor\"  id=\"step1_1\"></a>\n",
    "Analyze smart device data (FitBit data) to gain insight into how consumers are using their smart devices to gain insights and provide high-level recommendation for the company's marketing strategies.\n",
    "\n",
    "### 1.2 Analysis Objectives: <a class=\"anchor\"  id=\"step1_2\"></a> \n",
    "1. What are the trends identified?\n",
    "2. How could these trends apply to Bellabeat customers?\n",
    "3. How could these trends help influence Bellabeat marketing strategy?\n",
    "\n",
    "### 1.3 Deliverables: <a class=\"anchor\"  id=\"step1_3\"></a>\n",
    "1. A clear summary of the business task\n",
    "2. A description of all data sources used\n",
    "3. Documentation of any cleaning or manipulation of data\n",
    "4. A summary of your analysis\n",
    "5. Supporting visualizations and key findings\n",
    "6. Your top high-level content recommendations based on your analysis\n",
    "\n",
    "### 1.4 Key Stakeholders: <a class=\"anchor\"  id=\"step1_4\"></a>\n",
    "* **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer\n",
    "* **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n",
    "* **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy."
   ]
  },
