    "## Step 2: Prepare <a class=\"anchor\"  id=\"step2\"></a>\n",
    "\n",
    "In this step, the focus is to identify the dataset in order to answer our business tasks and objectives. \n",
    "\n",
    "### 2.1 Dataset Used: <a class=\"anchor\"  id=\"step2_1\"></a>\n",
    "* The dataset that would be used in this case study would be a publicly available dataset on Kaggle ([FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit)). \n",
    "* This Kaggle data set contains personal fitness tracker from thirty (30) fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data \n",
    "* There are 18 csv files from the dataset and these data is organized in either long or wide format.\n",
    "* This dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016.\n",
    "* Features including minute-level output for physical activity (daily activity, steps), heart rate, and sleep monitoring. \n",
    "* The dataset is made available publicly with the license of Creative Commons Zero (CC0)  where the dataset is dedicated to the public domain and users can copy, use, modify and distribute the data without asking the owner's permission.\n",
    "\n",
    "### 2.2 Limitation of the dataset: <a class=\"anchor\"  id=\"step2_2\"></a>\n",
    "* The data was collected back in 2016 for a period of 2 months, which could be quite dated. \n",
    "* There is a possibility of sampling bias as the small sample size of 30 users in the dataset is not representative of the entire female population and may be too small to provide comprehensive business recommendations.\n",
    "* It is impossible to verify the data integity as it was collected through survey.\n",
    "* There is no demographic variables such as gender or age.\n",
    "\n",
    "### 2.3 Is the dataset ROCC? <a class=\"anchor\"  id=\"step2_3\"></a>\n",
    "\n",
    "A good data source is ROCCC which stands for Reliable, Original, Comprehensive, Current, and Cited.\n",
    "\n",
    "* Reliable: Not reliable as it has only 30 respondents and does not represent the target population.\n",
    "* Original: Cannot be verified as the data was collected through third party (Amazon Mechanical Turk).\n",
    "* Comprehensive: Fairly comprehensive variables on smart device users that could be relevant to Bellabeat\n",
    "* Current: Data is dated for more than 5 years ago, which may no longer be reflective to current situation.\n",
    "* Cited: The Kaggle notebook has cited the source for the Fitbit dataset which can be found [here](https://zenodo.org/record/53894#.X9oeh3Uzaao).\n",
    "\n",
    "In summary, the dataset does not adhere to the ROCC conditions, which may not yield the best analysis. Nonetheless, the dataset may be able to provide some key insights about smart device users which can be used to answer the business task.\n",
    "\n",
    "#### 2.4 How does the dataset help answer our business task? <a class=\"anchor\"  id=\"step2_4\"></a>\n",
    "\n",
    "The dataset includes information about daily activity, steps, and heart rate that can be used to explore users’ habits, which will be able to provide us insights and hypothesis in developing marketing strategies for Bellabeat"
   ]
  },
