    "## STEP 3: Process <a class=\"anchor\"  id=\"step3\"></a>\n",
    "\n",
    "This step focuses on data preprocessing to remove any possible errors, inaccuracies, or inconsistencies. In this case study, we are using R as there are useful packages such as:\n",
    "\n",
    "* tidyverse - a set of R packages for data preparation, preprocessing and visualisation.\n",
    "* lubridate - R package that makes it easier to work with dates and times.\n",
    "* skimr - R package that provides summary statistics about variables in data frames, tibbles, data tables and vector.\n",
    "* janitor - R package that has simple functions for examining and cleaning dirty data.\n"
   ]
  },
