    "paste(\"The start and end date for dailyIntensities_merged is\",min(as.Date(intensities$ActivityHour,\"%m/%d/%Y\")),\"to\",max(as.Date(intensities$ActivityHour, \"%m/%d/%Y\")))\n",
    "paste(\"The start and end date for dailySteps_merged is\",min(as.Date(steps$ActivityHour,\"%m/%d/%Y\")),\"to\", max(as.Date(steps$ActivityHour, \"%m/%d/%Y\")))\n",
    "paste(\"The start and end date for sleepDay_merged is\",min(as.Date(sleep$SleepDay,\"%m/%d/%Y\")),\"to\", max(as.Date(sleep$SleepDay, \"%m/%d/%Y\")))\n",
    "paste(\"The start and end date for weightLogInfo_merged is\",min(as.Date(weight$Date,\"%m/%d/%Y\")),\"to\", max(as.Date(weight$Date, \"%m/%d/%Y\")))"
