   "source": [
    "#### 3.3.4 Changing the date columns in all data frames <a class=\"anchor\"  id=\"step3_3_4\"></a>\n",
    "\n",
    "The data type for all the date related columns are set to chr/strings, which is not appropriate. By using as.POSIXct() function, we would convert the string to datetime format. We then use glimpse() to check if the column is in the right format (expected format: dttm). "
   ]
