   "source": [
    "#Using as.POSIXct() function to convert string to datetime in R\n",
    "\n",
    "activity$ActivityDate <- as.POSIXct(activity$ActivityDate, format ='%m/%d/%Y')\n",
    "activity$ActivityDate <- as.Date(activity$ActivityDate)  #changing the dttm format to date                        \n",
    "glimpse(activity)\n",
    "\n",
    "calories$ActivityHour <- as.POSIXct(calories$ActivityHour, format ='%m/%d/%Y %I:%M:%S %p') #Uses %I instead of %H as we need to include %p for AM/PM indicator\n",
    "glimpse(calories)\n",
    "\n",
    "intensities$ActivityHour <- as.POSIXct(intensities$ActivityHour, format ='%m/%d/%Y %I:%M:%S %p')\n",
    "glimpse(intensities)\n",
    "\n",
    "steps$ActivityHour <- as.POSIXct(steps$ActivityHour, format ='%m/%d/%Y %I:%M:%S %p')\n",
    "glimpse(steps)\n",
    "\n",
    "sleep$SleepDay <- as.POSIXct(sleep$SleepDay, format ='%m/%d/%Y %I:%M:%S %p')\n",
    "sleep$SleepDay <- as.Date(sleep$SleepDay)  #changing the dttm format to date as this data frame contains daily records only\n",
    "glimpse(sleep)\n",
    "\n",
    "weight$Date <- as.POSIXct(weight$Date, format ='%m/%d/%Y %I:%M:%S %p')\n",
    "weight$Date <- as.Date(weight$Date)  #changing the dttm format to date as this data frame contains daily records only\n",
    "glimpse(weight)"
