    "#Checking if TotalDistance = TrackerDistance\n",
    "\n",
    "activity_check <- mutate(activity_check,TotalDistanceCheck = (TotalDistance - TrackerDistance))\n",
    "activity_check[activity_check$TotalDistanceCheck > 0,c(\"TotalDistanceCheck\",\"TotalDistance\",\"TrackerDistance\",\"sumDistanceCheck\")]\n",
    "\n",
    "#Checking the number of rows with significant difference between TotalDistance and TrackerDistance (TotalDistanceCheck > 0)\n",
    "print(count(activity_check[activity_check$TotalDistanceCheck > 0,c(\"TotalDistanceCheck\",\"TotalDistance\",\"TrackerDistance\",\"sumDistanceCheck\")]))\n",
    "\n",
    "#Checking if the three columns (TotalDistance,TrackerDistance and sumDistanceCheck is the same)\n",
    "sum(activity_check$TotalDistance)\n",
    "sum(activity_check$TrackerDistance)\n",
    "sum(activity_check$sumDistanceCheck)"
   ]
