   "source": [
    "#### 3.3.6 Summary on Data Cleaning: <a class=\"anchor\"  id=\"step3_3_6\"></a>\n",
    "\n",
    "From the above observations, it is noted that:\n",
    "\n",
    "1. It seems that there are 33 unique users instead of 30 as per described by the owner. However, the dailySleep_merged and weightLogInfo_merged only had 24 and 8 unique ID respectively. \n",
    "2. It seems like the Date column is in str/character which we have changed to the appropriate datatype (date/dttm) using as.Date() and as.POSIXct().\n",
    "3. All of the data does not have null values.\n",
    "4. There seems to have 65 missing values in weight table (column:Fat) - dirty data may affect our analysis.\n",
    "5. The sum of all the other distance variables (VeryActiveDistance, ModeratelyActiveDistance, LightActiveDistance, SedentaryActiveDistance) would not be represented by the columns TotalDistance or TrackerDistance as there might be some rounding errors. \n",
    "6. From the activity data frame, there is no sum column for all the ActiveMinutes features - we will add another column in the data manipulation part.\n",
    "7. Data from intensities and steps may have zero values in several columns. It may signify that the users are not moving or being active and will be kept in the table as it represents more than 1/3 of the data (9097/22099 observations).\n"
   ]
