   "source": [
    "## STEP 4: Analyze <a class=\"anchor\"  id=\"step4\"></a>\n",
    "\n",
    "\n",
    "This step focuses on data transformation and analysis on the Fitbit dataset to discover any patterns and summarizing their main characteristics. In this section, we would like to focus on one of the BellaBeat's product which is the Leaf. The Leaf is a classic wellness tracker which can be worn as a bracelet, necklace or clip, and the tracker connects to the Bellabeat app to track activity, sleep, and stress. As a competitor to Fitbit and other smart devices, we test the hypothesis that we have throughout this section using the data, and hopefully we would be able to identify trends that would help the marketing team to highlight the benefits of the Leaf as compared to the other competitors."
   ]
