   "source": [
    "#Merging calories and intensities into a temporary data frame before merging with steps, which results in the combined df of hourlyTracker\n",
    "hourlyTracker_temp <- inner_join(calories, intensities, by = c(\"Id\",\"ActivityHour\"))\n",
    "hourlyTracker <- inner_join(hourlyTracker_temp, steps, by = c(\"Id\",\"ActivityHour\"))\n",
    "\n",
    "head(hourlyTracker)"
   ]
  },
