    "#activity data frame\n",
    "#Using wday() to extract the day of the week and create a new column, Day, from the value in the date time column\n",
    "activity_new <- activity\n",
    "activity_new$Day <- wday(activity_new$ActivityDate, label=TRUE, abbr=FALSE)\n",
