   "source": [
    "Findings from the statistics do suggests that the users are engaging in regular exercises and are in acceptable health conditions. Some of the findings:\n",
    "\n",
    "* The **daily average total steps** logged by the 33 users is **7,638 steps**, which indicates that the user are in the recommended range of 7,000 - 13,000 steps a day. This may indicate that the users are health conscious and perhaps users who owns smart devices would makes the best out of it. Source: [NBC news article, Sept 2021](https://www.nbcnews.com/health/health-news/how-many-steps-day-should-you-take-study-finds-7-n1278853)\n",
    "* The **daily average total minutes** where the users are engaging in very active or fairly active activities is **21.16 minutes** and **13.56 minutes** respectively. This also supports the previous point where the users are generally active and have regular exercise regime as CDC's recommendation for physical activity is 150 minutes of moderate-intensity physical activity in a week or roughly 30 minutes a day. Source: [CDC Recommended Physical Activity for Health Benefits](https://www.cdc.gov/physicalactivity/basics/adults/index.htm)\n",
    "* The **daily average very lightly active minutes** is **192.8 minutes**, which is significantly higher than the other two categories, which suggests that most of the users are engaged in light physical activities that does not break a sweat, such as commuting to work or light housework like cooking.\n",
    "* The **daily average sedentary minutes** of the users are **1057.5 minutes** (17.6 hours) and the average **daily sleeping minutes** would be **419.5 minutes** (7 hours), which translates to around 10 hours of seating or not doing any physical activity. This suggests that while the users may be engaged in work that does not require much physical activity such as working at a desk or students in classroom. On the other hand, the users seems to have fairly healthy sleeping habit as the recommended hours of sleep is 7+ hours for adults. However, too much sitting time and prolonged periods of sitting sedeem to increase the risk of death from deadly diseases such as cardiovascular disease or cancer. Source: [Mayo Clinic](https://www.mayoclinic.org/healthy-lifestyle/adult-health/expert-answers/sitting/faq-20058005#:~:text=An%20analysis%20of%2013%20studies,posed%20by%20obesity%20and%20smoking.)\n",
    "* The **daily average calories burnt** is around **2,304** may suggest that users are regulary active as it is in the range of calorie needs per day for adult women (1,600 to 2,400 calories), assuming that the smart devices have fair accuracy on their caloric tracking. Source: [2015-2020 Dietary Guidelines by US Department of Health](https://health.gov/our-work/nutrition-physical-activity/dietary-guidelines/previous-dietary-guidelines/2015)\n",
    "* The **median BMI** of the 8 users logged is **24.39**, which is barely in the normal or Healthy weight range, which may suggest that these users are concerned about their health and perhaps the smart device would be a tool to achieve certain weight goals. Source: [CDC ](https://www.cdc.gov/healthyweight/assessing/index.html)"
   ]
