   "source": [
    "#Plotting a bar chart for users who used their smart devices all day\n",
    "ggplot(data = activity_h1, aes(x = WornAllDay, fill=WornAllDay)) +\n",
    "    geom_bar(stat = \"count\") +\n",
    "    stat_count(geom = \"text\", colour = \"white\", size = 3.5,       #Using stat_count for data labels\n",
    "    aes(label = ..count..),position=position_stack(vjust=0.5)) +   #Add data label to the centre of the \n",
    "\n",
    "    xlab(\"If the Smart Device Was Worn All Day\") +   #x-axis label\n",
    "    ylab(\"Count\") + #y-axis label\n",
    "    labs(title = \"Users who used their smart devices all day\") + #main title\n",
    "    theme(plot.title = element_text(hjust = 0.5))        #adjust for main title to be centered"
   ]
  },
