    "#Depict the outcome of the plot in a table format\n",
    "activity_h1_table <- count(activity_h1,WornAllDay) %>%     #Grouping the YES and NO from WornAllDay col\n",
    "    rename(Count = n) %>%      #Rename the count col to Count instead of default n\n",
    "    mutate(Percentage = Count/sum(Count))    #Create another column Percent to show the Percentages of YES and NO\n",
    "\n",
    "activity_h1_table"
   ]
