    "#Day of the week against TotalActiveMinutes (in hours)\n",
    "\n",
    "activity_h2 <- activity_new %>%\n",
    "                group_by(Day) %>%\n",
    "                summarize(sum_TotalActiveHours = round((sum(TotalActiveMinutes)/60),1))    \n",
