   "source": [
    "#Plotting the bar chart to identify the total active hours of the user for each day of the week\n",
    "ggplot(activity_h2) +\n",
    "    geom_col(mapping = aes(x=Day,y=sum_TotalActiveHours,fill=Day,label=Day)) +\n",
    "    geom_text(aes(x=Day,y=sum_TotalActiveHours,label = sum_TotalActiveHours, hjust = 1)) +        #Adding labels to the chart\n",
    "    \n",
    "    coord_flip() +\n",
    "    xlab(\"Day of the Week\") +   #x-axis label\n",
    "    ylab(\"Sum of Active Hours\") + #y-axis label\n",
    "    labs(title = \"Total Active Hours for Each Day of the Week\") + #main title\n",
    "    theme(plot.title = element_text(hjust = 0.5))        #adjust for main title to be centered"
   ]
  },
