    "#Average hours worn per day by each participant\n",
    "\n",
    "activity_h3 <- activity_new %>%\n",
    "                group_by(Id) %>%\n",
    "                summarize(avg_TotalActiveHours = round(mean(TotalActiveMinutes/60),1))\n",
    "\n",
    "head(activity_h3)"
   ]
