   "source": [
    "#Plotting using geom_point on Average Hours Worn Per Day by Each Participant\n",
    "\n",
    "ggplot(activity_h3_2, aes(x=Day,y=TotalActiveHours,group=1)) +\n",
    "    geom_point() +\n",
    "    geom_smooth(color = \"#008080\") +\n",
    "    xlab(\"Day of the Week\") +   #x-axis label\n",
    "    ylab(\"Total Active Hours per day\") +    #y-axis label\n",
    "    labs(title = \"Average Hours Worn Per Day by Each Participant\") + #main title\n",
    "    theme(plot.title = element_text(hjust = 0.5))        #adjust for main title to be centered"
   ]
