   "source": [
    "#Number of instances logged where the total active hours is over or under the average\n",
    "\n",
    "more20 <- count(activity_h3_2[activity_h3_2$TotalActiveHours >= 20.3,]) #Finding the count where TotalActiveHours >=20.3\n",
    "less20 <- count(activity_h3_2[activity_h3_2$TotalActiveHours < 20.3,])  #Finding the count where TotalActiveHours <20.3\n",
    "\n",
    "activity_h3_table <- rbind(more20,less20)    #Combine into a table\n",
    "rownames(activity_h3_table) <- c(\"Total Active Hours >= 20.3 hrs\",\"Total Active Hours < 20.3 hrs\")\n",
    "\n",
    "activity_h3_table <- activity_h3_table %>%\n",
    "                        rename(Count = n) %>%      #Rename the count col to Count instead of n\n",
    "                        mutate(Percentage = Count/sum(Count))    #Create another column Percentage\n",
    "\n",
    "activity_h3_table"
