   "source": [
    "#The graph for Number of Days Logged in Sleep by Each Participant\n",
    "\n",
    "ggplot(sleep_h5, aes(x=reorder(rownames(sleep_h5),Days_Logged),y=Days_Logged)) +\n",
    "    geom_point(size = 3) +  #size = increases the point size\n",
    "    geom_segment(aes(x=reorder(rownames(sleep_h5),Days_Logged),xend=reorder(rownames(sleep_h5),Days_Logged),y=0,yend=Days_Logged)) +  #The stem for the lolipop chart\n",
    "    labs(title=\"Number of Days Logged in Sleep by Each Participant\",hjust = 0.5) +   #main title\n",
    "    xlab(\"Unique ID Represented by Number\") +      #x-axis label\n",
    "    ylab(\"Number of Days Logged in Sleep\") +       #y-axis label\n",
    "    theme(plot.title = element_text(hjust = 0.5))  #adjust plot title to centre\n"
   ]
  },
