    "#Combining daily activity tracker and sleep data frames\n",
    "steps_sleep <- merge(x= activity_new[,c(\"Id\",\"ActivityDate\",\"Day\",\"TotalSteps\")],y=sleep_new[,c(\"Id\",\"TotalMinutesAsleep\",\"TotalTimeInBed\")],by = \"Id\")\n",
    "head(steps_sleep)"
   ]
