   "source": [
    "#Plot Steps taken vs Sleep\n",
    "ggplot(steps_sleep,aes(x=TotalSteps,y=TotalMinutesAsleep)) +\n",
    "    geom_point() +\n",
    "    geom_smooth(method=\"lm\",se=F) +\n",
    "    labs(title=\"Total Steps vs Total Minutes Asleep\",hjust = 0.5) +   #main title\n",
    "    xlab(\"Total Steps\") +      #x-axis label\n",
    "    ylab(\"Total Minutes Asleep\") +       #y-axis label\n",
    "    theme(plot.title = element_text(hjust = 0.5))  #adjust plot title to centre"
   ]
