   "source": [
    "# When is the users more active during day or night?\n",
    "\n",
    "hourlyTracker_h6 <- hourlyTracker_new %>%\n",
    "                        group_by(Time) %>%\n",
    "                        summarize(Average_Calories = mean(Calories),Average_Steps = mean(StepTotal))\n",
    "\n",
    "head(hourlyTracker_h6)"
   ]
