   "source": [
    "#Plotting the bar chart to identify the total active hours of the user for each day of the week\n",
    "ggplot(activity_h3) +\n",
    "    geom_col(mapping = aes(x=reorder(rownames(activity_h3),avg_TotalActiveHours),y=avg_TotalActiveHours),fill =\"#FFC0CB\") +\n",
    "    geom_hline(yintercept =20.3) +  #Adding a horizontal line to indicate the overall average total active hours  \n",
    "    xlab(\"Participant Number\") +   #x-axis label\n",
    "    ylab(\"Average Active Hours\") + #y-axis label\n",
    "    labs(title = \"Average Hours Worn Per Day by Each Participant\") + #main title\n",
    "    theme(plot.title = element_text(hjust = 0.5))        #adjust for main title to be centered"
   ]
  },
