   "source": [
    "#Visualizing the active hours in the day\n",
    "\n",
    "ggplot(hourlyTracker_h6) +\n",
    "    geom_col(mapping = aes(x=reorder(Time,desc(Time)),y=Average_Steps,fill=Time,label=Time)) +\n",
    "    coord_flip() +\n",
    "    xlab(\"Time of the Day\") +   #x-axis label\n",
    "    ylab(\"Average Steps of the Hour & Average Calories Burnt in the Hour (point)\") + #y-axis label\n",
    "    labs(title = \"Average Steps of Users based on the Time of the Day\") + #main title\n",
    "    theme(plot.title = element_text(hjust = 0.5),legend.position=\"right\")    +    #adjust for main title to be centered\n",
    "    \n",
    "    geom_point(mapping = aes(x=reorder(Time,desc(Time)),y=Average_Calories),size=3)  #Average Calories burnt based on the time of the day\n"
   ]
