    "## STEP 6: Act <a class=\"anchor\"  id=\"step6\"></a>\n",
    "\n",
    "The final step focusing on providing the stakeholders with recommendations based on the findings so that they could make data-driven decisions for Bellabeat's marketing strategies. Using our Analysis Objectives set at the start of this case study, we would provide the appropriate recommendations. In a nutshell, we revisit our business task and analysis objectives along with using Leaf as the product of choice for recommendation. \n",
    "\n",
    "**1. What are the trends identified?**\n",
    "\n",
    "    * Fitbit users uses their smart devices throughout the day (Average = 20 hours/day)\n",
    "    * Fitbit users wear their tracker even though they are not engaged in physical activity (81% on Sedentary)\n",
    "    * Fitbit users are most active during the weekdays and especially in the evenings (5-7pm)\n",
    "    * Sleep logging is not a feature that is used extensively by Fitbit users\n",
    "\n",
    "**2. How could these trends apply to Bellabeat customers?**\n",
    "    \n",
